import React from 'react';
import Main from './mainPage/Main'
import { BrowserRouter as Router, Route, Link } from 'react-router';


function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path="/" component={Main}></Route>
        <Route></Route>
        <Route></Route>
      </Router>
    </div>
  );
}

export default App;
